import React from 'react';
import { Helmet } from 'react-helmet';
import '../css/Landingpage.css';

const Landingpage = (props) => {
    return (
        <div className="landingpage-container">
            <Helmet>
                <title>exported project</title>
            </Helmet>
            <div className="landingpage-landingpage">
                <div className="landingpage-frame5">
                    <div className="landingpage-frame1">
                        <a href="#home" className="landingpage-text10">Home</a>
                        <a href="#about" className="landingpage-text11">About</a>
                        <a href="#hotels" className="landingpage-text12">Hotels & Villas</a>
                        <a href="#flights" className="landingpage-text13">Flights</a>
                        <a href="#blog" className="landingpage-text14">Blog</a>
                        <div className="landingpage-frame31">
                            <div className="landingpage-frame2">
                                <a href="#signin" className="landingpage-text15">Sign In</a>
                            </div>
                            <div className="landingpage-frame32">
                                <a href="#signup" className="landingpage-text16">Sign Up</a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Landingpage;
